import './_home.scss';



function Home() {
    return (
        <div className="home">
            <header>
                <h1>Welcome to My Website</h1>
                <p>
                    In this website we check your knowledge on music
                </p>
                <button><h2>Join</h2></button>
                <div class = "space">   
                </div>
                <button><h2>creat</h2></button>
                </header>

            <footer>
                <p>&copy; 2023 Music hackathon Website</p>
            </footer>
        </div>
    );
}



export default Home;
